import React from "react";
import { useUser } from "./context/UserContext";

const UserInfo = () => {
  const { user, logOut } = useUser();
  return (
    <div>
      {user ? (
        <>
          <h1> Welcome, {user.username}!</h1>
          <button onClick={logOut}>Log Out</button>
        </>
      ) : (
        <p>Please Log In</p>
      )}
    </div>
  );
};

export default UserInfo;
